const sigmoid = x => 1 / (1 + Math.exp(-x))

function predict(input) {
  const hidden = [];
  for (let i = 0; i < 20; i++) {
    let sum = 0;
    for (let j = 0; j < 625; j++) {
      sum += input[j] * weightsIH[j][i];
    }
    sum += biasH[i];
    hidden.push(sigmoid(sum));
  }


  const output = [];
  for (let i = 0; i < 10; i++) {
    let sum = 0;
    for (let j = 0; j < 20; j++) {
      sum += hidden[j] * weightsHO[j][i];
    }
    sum += biasO[i];
    output.push(sigmoid(sum));
  }

  return [[...output].sort((a, b) => b - a).filter((e, index) => index < 3 ).map((elem) => [output.indexOf(elem), Math.floor(elem*100)])]
}

